	//将两千条数据进行拆分,拆分成每份100个
	public static void analysisData() {
		String data=getString();
		JSONArray arrayData=JSONArray.parseArray(data);
		List<List> dataList=arrayData.toJavaList(List.class);
		int size=dataList.size();
		System.out.println("size->"+size);
		int copies=getCopies(size);
		List<List<Object>> result=new ArrayList<List<Object>>();
		Stream.iterate(0, a->a+1).limit(copies).forEach(a->{
			result.add(dataList.stream().skip(a*MAX_EACH_COUNT).limit(MAX_EACH_COUNT).collect(Collectors.toList()));
		});
		result.forEach(System.out::println);
		System.out.println("result size->"+result.size());
	}
	
	public static int getCopies(int size) {
		return (size+MAX_EACH_COUNT-1)/MAX_EACH_COUNT;
	}
	
	public static void doa(List<List> param) throws InterruptedException {
		System.out.println(param+"   start");
		TimeUnit.SECONDS.sleep(param.size()/10);
		System.out.println(param+"   done");
	}
	
	
